import React from "react";
import ReactBodymovin from "react-bodymovin";
import animation from "./blood.json";
import "./icons.css";
const Icons = () => {
  const iconOne = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: animation
  };
  const iconTwo = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: animation
  };

  return (
    <div className="svg">
      <ReactBodymovin options={iconOne} />
      <p>Test</p>
      <ReactBodymovin options={iconTwo} />
      <p>Test</p>
    </div>
  );
};

export default Icons;
